script: |
  super -f tsv -I q10678.sql | sort > q10678.out

vector: true

inputs:
  - name: q10678.sql
    data: |
      SELECT DISTINCT - 3 - + COUNT ( * ) FROM tab1 WHERE NOT CAST ( NULL AS INTEGER ) - - col2 NOT IN ( + col0 * + col1 );
  - name: tab1

outputs:
  - name: q10678.out
    data: |
      -3
